import React from "react";
import '../css/Serch.css'
import picture from '../img/serch.png'

class Serch extends React.Component {
    render() {
        return(
            <div className="input-group">
                <img src={picture}/>
                <input placeholder="Поиск"/>
            </div>
        )
    }
}

export default Serch
